// src/App.jsx
import { useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./Login";
import Dashboard from "./Dashboard";

export default function App() {
  const [commissionData, setCommissionData] = useState([]);
  const [violationData, setViolationData] = useState([]);
  const [user, setUser] = useState(null);

  useEffect(() => {
    fetch("https://script.google.com/macros/s/AKfycbzSjgMyzv1ciX5MeW_f5Doh9gWydDGpN2Txz8gUSdf1nNq8TpxWlyyGFvJCbG-QwJM4/exec")
      .then((res) => res.json())
      .then((data) => setCommissionData(data))
      .catch((err) => console.error("Commission Error", err));

    fetch("https://script.google.com/macros/s/AKfycbw5FIPX_XqlxHqwEuZZqugW0cwNG1zk2SI28q8ri0cm7XDDEkZ1ncgUk5v6ZMGrvpJp/exec")
      .then((res) => res.json())
      .then((data) => setViolationData(data))
      .catch((err) => console.error("Violation Error", err));
  }, []);

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={<Login setUser={setUser} />}
        />
        <Route
          path="/dashboard"
          element={
            <Dashboard
              user={user}
              commissionData={commissionData}
              violationData={violationData}
            />
          }
        />
      </Routes>
    </Router>
  );
}
